'use strict';

require('plugins/tagcloud/tag_cloud.less');

require('plugins/tagcloud/tag_cloud_controller');

require('plugins/tagcloud/tag_cloud_vis_params');

var _vis_factory = require('ui/vis/vis_factory');

var _vis_category = require('ui/vis/vis_category');

var _schemas = require('ui/vis/editors/default/schemas');

var _tag_cloud_controller = require('plugins/tagcloud/tag_cloud_controller.html');

var _tag_cloud_controller2 = _interopRequireDefault(_tag_cloud_controller);

var _vis_types = require('ui/registry/vis_types');

var _iconTagcloud = require('./images/icon-tagcloud.svg');

var _iconTagcloud2 = _interopRequireDefault(_iconTagcloud);

function _interopRequireDefault(obj) { return obj && obj.__esModule ? obj : { default: obj }; }

_vis_types.VisTypesRegistryProvider.register(function TagCloudProvider(Private) {
  var VisFactory = Private(_vis_factory.VisFactoryProvider);
  var Schemas = Private(_schemas.VisSchemasProvider);

  return VisFactory.createAngularVisualization({
    name: 'tagcloud',
    title: 'Tag Cloud',
    image: _iconTagcloud2.default,
    description: 'A group of words, sized according to their importance',
    category: _vis_category.CATEGORY.OTHER,
    visConfig: {
      defaults: {
        scale: 'linear',
        orientation: 'single',
        minFontSize: 18,
        maxFontSize: 72
      },
      template: _tag_cloud_controller2.default
    },
    responseHandler: 'tabify',
    editorConfig: {
      collections: {
        scales: ['linear', 'log', 'square root'],
        orientations: ['single', 'right angled', 'multiple']
      },
      optionsTemplate: '<tagcloud-vis-params></tagcloud-vis-params>',
      schemas: new Schemas([{
        group: 'metrics',
        name: 'metric',
        title: 'Tag Size',
        min: 1,
        max: 1,
        aggFilter: ['!std_dev', '!percentiles', '!percentile_ranks', '!derivative', '!geo_bounds', '!geo_centroid'],
        defaults: [{ schema: 'metric', type: 'count' }]
      }, {
        group: 'buckets',
        name: 'segment',
        icon: 'fa fa-cloud',
        title: 'Tags',
        min: 1,
        max: 1,
        aggFilter: ['terms']
      }])
    }
  });
});
